INSERT INTO `courses` (`id`, `name`, `code`, `slug`, `sumary`, `content`, `teacher`, `status`, `deleted_at`, `created_at`, `updated_at`, `meta_title`, `meta_keywords`, `meta_description`, `image`) VALUES
(1, 'Khóa học Nodejs', 'KH1', 'khoa-hoc-nodejs', NULL, '<p>Khóa học Nodejs<br></p>', '', 1, '2018-06-15 02:38:57', '2018-06-01 04:49:05', '2018-06-15 02:38:57', NULL, NULL, NULL, '/uploads/courses/khoa-hoc-nodejs2018-06-01.jpg'),
(2, 'Khóa Học Lập trình Android', 'KH2', 'khoa-hoc-lap-trinh-android', NULL, '<p>Khóa Học Lập trình Android<br></p>', '', 1, '2018-06-15 02:38:55', '2018-06-01 04:54:48', '2018-06-15 02:38:55', 'Khóa Học Lập trình Android', NULL, 'Khóa Học Lập trình Android', '/uploads/courses/khoa-hoc-lap-trinh-android2018-06-01.jpg'),
(3, 'Autocad thiết kế bản vẽ XD', 'KH3', 'autocad-thiet-ke-ban-ve-xd', 'AutoCAD-2D Thiết kế bản vẽ xây dựng (AutoCAD-2D for designing and developing engineering drawings)\r\nTham gia khóa học, học viên sẽ được hướng dẫn cách sử dụng phần mềm AutoCAD để tạo các đối tượng trong bản vẽ kỹ thuật nói chung và trong bản vẽ xây dựng nói riêng. Từ đó học viên có thể tự tin sử dụng phần mềm này trong việc xây dựng và thể hiện bản vẽ thiết kế xây dựng ở mô hình 2D. Học viên sẽ được học và thực hành các câu lệnh cơ bản để tạo, hiệu chỉnh đối tượng, trình bày và quản lý đối tượng nhanh và chính xác để có được bản vẽ đẹp. Ngoài ra học viên còn được học và thực hành các thủ thuật, ứng dụng hay khác của phần mềm như xuất mô hình sang phần mềm tính toán kết cấu SAP2000, copy ảnh có chất lượng cao sang Word hay xác định các đặc trưng hình học của hình phẳng phức tạp. Chỉ cần bạn muốn tìm hiểu về thiết kế bản vẽ trên AutoCAD là bạn đã đủ điều kiện để tham gia khóa học này rồi :)', '<p style=\"text-align:justify\"><strong><span style=\"font-family:calibri,sans-serif; font-size:14px\">AutoCAD-2D Thiết kế bản vẽ x&acirc;y dựng</span></strong><span style=\"font-size:9.0pt\"><span style=\"font-size:14px\"> (</span><em><span style=\"color:blue\"><span style=\"font-size:14px\">AutoCAD-2D for designing and developing engineering drawings)</span></span></em></span></p>\r\n\r\n<p style=\"text-align:justify\"><u><strong>Sau kh&oacute;a học, học vi&ecirc;n sẽ:</strong></u></p>\r\n\r\n<p style=\"text-align:justify\">+ Học vi&ecirc;n tự tin về tạo, hiệu chỉnh v&agrave; thể hiện c&aacute;c đối tượng tr&ecirc;n bản vẽ x&acirc;y dựng nhanh, đẹp v&agrave; khoa học;</p>\r\n\r\n<p style=\"text-align:justify\">+&nbsp;Nắm vững c&aacute;c t&iacute;nh năng n&acirc;ng cao (Auto lisp); in bản vẽ; xuất bản vẽ sang c&aacute;c m&ocirc;i trường kh&aacute;c;</p>\r\n\r\n<p style=\"text-align:justify\">+&nbsp;X&aacute;c định c&aacute;c đặc trưng h&igrave;nh học của h&igrave;nh phức tạp&hellip;</p>', '<p style=\"text-align:left\"><span style=\"color:#0000FF\"><span style=\"font-size:18px\">THS. NGUYỄN ĐĂNG THẠCH</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:18px\">Kinh nghiệm:</span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:18px\">+&nbsp;</span><span style=\"font-family:calibri,sans-serif; font-size:12pt\">Tham gia thiết kế c&aacute;c c&ocirc;ng tr&igrave;nh nh&agrave; phố, biệt thự cho dự &aacute;n của C&ocirc;ng ty tư vấn thiết kế Th&agrave;nh phố - Cityland</span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-family:calibri,sans-serif; font-size:12pt\">+&nbsp;</span><span style=\"font-family:calibri,sans-serif; font-size:12pt\">Tham gia thiết kế cho c&aacute;c dự &aacute;n nh&agrave; th&eacute;p tiền chế của c&ocirc;ng ty Kết cấu th&eacute;p ATAD</span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-family:calibri,sans-serif; font-size:12pt\">+&nbsp;</span><span style=\"font-family:calibri,sans-serif; font-size:12pt\">Tham gia thiết kế kết cấu s&agrave;n cho dự &aacute;n si&ecirc;u thị An Ph&uacute;</span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-family:calibri,sans-serif; font-size:12pt\">+&nbsp;</span><span style=\"font-family:calibri,sans-serif; font-size:12pt\">Thiết kế kết cấu c&aacute;c dạng nh&agrave; d&acirc;n dụng kh&aacute;c</span></p>', 1, NULL, '2018-06-03 07:40:07', '2018-06-21 09:40:13', 'Autocad thiết kế bản vẽ XD', NULL, 'Autocad thiết kế bản vẽ XD', '/uploads/courses/autocad-thiet-ke-ban-ve-xd2018-06-15.jpg'),
(4, 'Khóa Học IOS', 'KH4', 'khoa-hoc-ios', NULL, '<p>Khóa Học IOS<br></p>', '', 1, '2018-06-15 02:38:46', '2018-06-03 07:51:23', '2018-06-15 02:38:46', 'Khóa Học IOS', 'Khóa Học IOS', 'Khóa Học IOS', '/uploads/courses/khoa-hoc-ios2018-06-03.png'),
