(14, 'Lập tiến độ và quản lý dự án xây dựng bằng Microsoft Project', 'KH14', 'lap-tien-do-va-quan-ly-du-an-xay-dung-bang-microsoft-project', 'Lập tiến độ và quản lý xây dựng bằng Microsoft Project (Scheduling and construction management using Microsoft Project) \r\nKhóa học cung cấp cho học viên những kiến thức và kỹ năng trong việc tổ chức lập kế hoạch và quản lý dự án bằng phần mềm Microsoft Project. Mục tiêu của khóa học là giúp cho người học có thể sử dụng thành thạo phần mềm Microsoft Project trong việc lập tiến độ của dự án, theo dõi tài chính của dự án, phân phối và sử dụng tài nguyên của dự án một cách hợp lý, điều chỉnh tiến độ dự án khi có các điều kiện bất lợi và lập báo cáo về tiến độ dự án trong các cuộc họp. Khóa học phù hợp cho các bạn sinh viên khối ngành kỹ thuật xây dựng, công trình giao thông, kinh tế xây dựng và các kỹ sư xây dựng đã đi làm có nhu cầu nâng cao chuyên môn về lập tiến độ và quản lý dự án.', '<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>M&ocirc; tả chung m&ocirc;n học (Course Description):</strong></p>\r\n\r\n<p style=\"margin-left:17.0pt; margin-right:0cm; text-align:justify\"><em><span style=\"font-size:12.0pt\">Kh&oacute;a học MS Project bao gồm 8 buổi học thực h&agrave;nh tr&ecirc;n m&aacute;y t&iacute;nh, mỗi buổi c&oacute; thời lượng 180 ph&uacute;t. Kh&oacute;a học sẽ dạy học vi&ecirc;n c&aacute;ch sử dụng phần mềm MS Project để quản l&yacute; dự &aacute;n n&oacute;i chung v&agrave; dự &aacute;n x&acirc;y dựng n&oacute;i ri&ecirc;ng. Kh&oacute;a học cung cấp cho sinh vi&ecirc;n những kiến thức căn bản về quản l&yacute; dự &aacute;n, hiểu c&aacute;ch thức tổ chức c&ocirc;ng việ; thế n&agrave;o l&agrave; quản l&yacute; t&agrave;i nguy&ecirc;n v&agrave; chi ph&iacute; cho một dự &aacute;n v&agrave; l&agrave;m sao để theo d&otilde;i tiến độ của dự &aacute;n. Th&ocirc;ng qua b&agrave;i giảng, b&agrave;i tập c&aacute; nh&acirc;n học vi&ecirc;n sẽ thực h&agrave;nh với việc lập kế hoạch, ph&acirc;n phối v&agrave; sử dụng t&agrave;i nguy&ecirc;n, theo d&otilde;i v&agrave; cập nhật tiến độ dự &aacute;n.</span></em></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>Y&ecirc;u cầu kh&oacute;a học (Course Requirement):</strong></p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:12.0pt\">Học vi&ecirc;n được cấp chứng nhận khi đủ c&aacute;c điều kiện:</span></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:12.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt\">Học vi&ecirc;n được y&ecirc;u cầu dự &iacute;t nhất 5/8 buổi;</span></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:12.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt\">Đạt từ 5.0 điểm trở l&ecirc;n của b&agrave;i thi cuối kh&oacute;a.</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>C&aacute;ch đ&aacute;nh gi&aacute; kh&oacute;a học (Course Assessment):</strong></p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:12.0pt\">Học vi&ecirc;n phải l&agrave;m b&agrave;i thi thực h&agrave;nh tr&ecirc;n m&aacute;y t&iacute;nh, thời gian 120 ph&uacute;t để kiểm tra c&aacute;c kiến thức v&agrave; c&aacute;c kỹ năng đ&atilde; học trong 8 buổi trước đ&oacute;; Điểm đạt </span><span style=\"font-family:symbol; font-size:12.0pt\">&sup3;</span><span style=\"font-size:12.0pt\"> 5.0/10.</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>Phương thức học, thực h&agrave;nh (Learning methods):</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:12.0pt\">Học vi&ecirc;n được hướng dẫn bởi giảng vi&ecirc;n, đồng thời được thực hiện ngay tr&ecirc;n m&aacute;y t&iacute;nh c&aacute; nh&acirc;n (Laptop) tại ph&ograve;ng học để tăng t&iacute;nh hiệu quả của b&agrave;i học. Sau buổi học, học vi&ecirc;n được giao b&agrave;i tập về nh&agrave; để thực h&agrave;nh th&ecirc;m.&nbsp;</span></p>', '<p>THS. ĐỖ HO&Agrave;NG HẢI</p>\r\n\r\n<p>THS. NGUYỄN DUY HƯNG</p>', 1, NULL, '2018-06-15 03:24:05', '2018-06-19 09:18:51', 'Lập tiến độ và quản lý dự án xây dựng bằng Microsoft Project', NULL, 'Lập tiến độ và quản lý dự án xây dựng bằng Microsoft Project', '/uploads/courses/lap-tien-do-va-quan-ly-du-an-xay-dung-bang-microsoft-project2018-06-15.jpg'),
(15, 'Đọc, hiểu và triển khai bản vẽ kỹ thuật xây dựng', 'KH15', 'doc-hieu-va-trien-khai-ban-ve-ky-thuat-xay-dung', 'Đọc, hiểu và triển khai bản vẽ kỹ thuật xây dựng (Read, understand and detailing for engineering drawings)\r\nBạn đã từng đọc và triển khai bản vẽ của một công trình thực tế? Đọc một bản vẽ bắt đầu từ đâu và triển khai bằng cách nào? Đối với kỹ sư xây dựng thì đọc, hiểu và triển khai bản vẽ kỹ thuật xây dựng là rất quan trọng. Với những kinh nghiệm thực tế, các giảng viên HCT sẽ hướng dẫn bạn làm quen với các bản vẽ của công trình thực tế, từng bước nắm được các ký hiệu, quy ước trong bản vẽ, từ đó triển khai bản vẽ chi tiết (shop drawings) phục vụ cho công tác thi công. Khóa học phù hợp cho các bạn học viên khối ngành kỹ thuật, kinh tế xây dựng, là cơ sở để các học viên có thể tham gia khóa học đo, bóc khối lượng, lập dự toán xây dựng.', '<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>M&ocirc; tả chung m&ocirc;n học (Course Description):</strong></p>\r\n\r\n<p style=\"margin-left:17.0pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:13.0pt\">Thực h&agrave;nh</span><span style=\"font-size:13.0pt\"> đọc hiểu v&agrave; triển khai bản vẽ thi c&ocirc;ng x&acirc;y dựng </span><span style=\"font-size:13.0pt\">c&ocirc;ng tr&igrave;nh bao gồm 1</span><span style=\"font-size:13.0pt\">2</span><span style=\"font-size:13.0pt\"> buổi học</span><span style=\"font-size:13.0pt\"> v&agrave;</span><span style=\"font-size:13.0pt\"> thực h&agrave;nh</span><span style=\"font-size:13.0pt\">, </span><span style=\"font-size:13.0pt\">mỗi buổi c&oacute; thời lượng 150 ph&uacute;t. </span><span style=\"font-size:13.0pt\">Kh&oacute;a học sẽ gi&uacute;p học vi&ecirc;n l&agrave;m quen với m&ocirc;i trường l&agrave;m việc thực tế về c&aacute;ch xem hiểu bản vẽ thi c&ocirc;ng x&acirc;y dựng, triển khai chi tiết bản vẽ kỹ thuật để thi c&ocirc;ng. Học vi&ecirc;n sẽ được học v&agrave; thực h&agrave;nh tr&ecirc;n c&aacute;c c&ocirc;ng tr&igrave;nh thực tế.</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>Y&ecirc;u cầu kh&oacute;a học (Course Requirement):</strong></p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:13.0pt\">Học vi&ecirc;n được cấp chứng nhận khi đủ c&aacute;c điều kiện:</span></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:13.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:13.0pt\">Học vi&ecirc;n được y&ecirc;u cầu dự &iacute;t nhất 9/12 buổi;</span></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:13.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:13.0pt\">Đạt từ 5.0 điểm trở l&ecirc;n của b&agrave;i thi cuối kh&oacute;a.</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>C&aacute;ch đ&aacute;nh gi&aacute; kh&oacute;a học (Course Assessment):</strong></p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:13.0pt\">Học vi&ecirc;n phải l&agrave;m b&agrave;i thi thực h&agrave;nh tr&ecirc;n m&aacute;y t&iacute;nh, thời gian 45 ph&uacute;t để kiểm tra c&aacute;c kiến thức v&agrave; c&aacute;c kỹ năng đ&atilde; học trong 12 buổi trước đ&oacute;; Điểm đạt </span><span style=\"font-family:symbol; font-size:13.0pt\">&sup3;</span><span style=\"font-size:13.0pt\"> 5.0/10.</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>Phương thức học, thực h&agrave;nh (Learning methods):</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:13.0pt\">Học vi&ecirc;n được hướng dẫn bởi giảng vi&ecirc;n, đồng thời được thực hiện ngay tr&ecirc;n m&aacute;y t&iacute;nh c&aacute; nh&acirc;n (Laptop) tại ph&ograve;ng học với c&aacute;c bản vẽ của c&ocirc;ng tr&igrave;nh thực tế để tăng t&iacute;nh hiệu quả của b&agrave;i học. Sau buổi học, học vi&ecirc;n được giao b&agrave;i tập về nh&agrave; để thực h&agrave;nh th&ecirc;m.&nbsp;</span></p>', '<p>THS. VỖ Đ&Igrave;NH NHẬT KH&Aacute;NH</p>', 1, NULL, '2018-06-15 03:32:50', '2018-06-18 13:19:57', 'Đọc, hiểu và triển khai bản vẽ kỹ thuật xây dựng', NULL, 'Đọc, hiểu và triển khai bản vẽ kỹ thuật xây dựng', '/uploads/courses/doc-hieu-va-trien-khai-ban-ve-ky-thuat-xay-dung2018-06-15.jpg'),
(16, 'Đo, bóc khối lượng và lập dự toán xây dựng', 'KH16', 'do-boc-khoi-luong-va-lap-du-toan-xay-dung', 'Đo, bóc khối lượng và lập dự toán xây dựng  (Cost estimation for construction projects).\r\nĐến với khóa học, học viên sẽ được hướng dẫn phương pháp đo bóc khối lượng theo quy định hiện hành của Bộ Xây dựng, áp dụng các định mức, đơn giá dự toán để lập dự toán chi tiết cho công trình, hạng mục công trình, vận dụng định mức chi phí tư vấn, chi phí quản lý dự án… để lập tổng dự toán xây dựng công trình, từ đó làm quen khái niệm tổng mức đầu tư dự án. Học viên được sử dụng phần mềm dự toán bản quyền để học tập và thực hành. Khóa học phù hợp cho các bạn học viên cuối năm thứ 3 khối ngành kỹ thuật, kinh tế xây dựng, kỹ sư xây dựng đã đi làm muốn nâng cao chuyên môn về lập dự toán xây dựng.', '<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>M&ocirc; tả chung m&ocirc;n học (Course Description):</strong></p>\r\n\r\n<p style=\"margin-left:17.0pt; margin-right:0cm; text-align:justify\"><em><span style=\"font-size:12.0pt\">Kh&oacute;a học Đo b&oacute;c khối lượng &amp; lập dự to&aacute;n bao gồm 14 buổi học kết hợp l&yacute; thuyết v&agrave; thực h&agrave;nh tr&ecirc;n m&aacute;y t&iacute;nh, mỗi buổi c&oacute; thời lượng 180 ph&uacute;t.</span></em></p>\r\n\r\n<p style=\"margin-left:17.0pt; margin-right:0cm; text-align:justify\"><em><span style=\"font-size:12.0pt\">Kh&oacute;a học sẽ dạy học vi&ecirc;n kỹ năng đọc bản vẽ v&agrave; đo b&oacute;c khối lượng một c&ocirc;ng tr&igrave;nh d&acirc;n dụng cụ thể</span></em><em><span style=\"font-size:12.0pt\"> v&agrave; c&ocirc;ng tr&igrave;nh đường</span></em><em><span style=\"font-size:12.0pt\">. Tr&ecirc;n cơ sở đ&oacute;, người học sẽ được hướng dẫn &aacute;p dụng c&aacute;c văn bản quy phạm ph&aacute;p luật, c&aacute;c chế độ ch&iacute;nh s&aacute;ch của Nh&agrave; nước,&hellip; để t&iacute;nh to&aacute;n, x&aacute;c định gi&aacute; x&acirc;y dựng c&ocirc;ng tr&igrave;nh. Trong đ&oacute;, người học sẽ biết t&iacute;nh to&aacute;n, x&aacute;c định c&aacute;c yếu tố đầu v&agrave;o của gi&aacute; x&acirc;y dựng c&ocirc;ng tr&igrave;nh như:</span></em></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-size:12.0pt\">-<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><em><span style=\"font-size:12.0pt\">X&aacute;c định gi&aacute; vật liệu x&acirc;y dựng đến ch&acirc;n c&ocirc;ng tr&igrave;nh; </span></em></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-size:12.0pt\">-<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><em><span style=\"font-size:12.0pt\">X&aacute;c định đơn gi&aacute; nh&acirc;n c&ocirc;ng x&acirc;y dựng theo từng địa b&agrave;n;</span></em></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-size:12.0pt\">-<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><em><span style=\"font-size:12.0pt\">X&aacute;c định gi&aacute; ca m&aacute;y v&agrave; thiết bị thi c&ocirc;ng theo từng thời điểm.</span></em></p>\r\n\r\n<p style=\"margin-left:17.0pt; margin-right:0cm; text-align:justify\"><em><span style=\"font-size:12.0pt\">Đồng thời, người học biết vận dụng, &aacute;p dụng c&aacute;c loại Định mức v&agrave; đơn gi&aacute; trong x&acirc;y dựng; biết x&aacute;c định c&aacute;c khoản mục chi ph&iacute; Tư vấn x&acirc;y dựng (như chi ph&iacute; thiết kế, chi ph&iacute; gi&aacute;m s&aacute;t,&hellip;); Chi ph&iacute; Quản l&yacute; dự &aacute;n; Chi ph&iacute; Kh&aacute;c; Chi ph&iacute; Dự ph&ograve;ng; </span></em></p>\r\n\r\n<p style=\"margin-left:17.0pt; margin-right:0cm; text-align:justify\"><em><span style=\"font-size:12.0pt\">Trong qu&aacute; tr&igrave;nh l&agrave;m c&aacute;c b&agrave;i tập, người học sẽ được hướng dẫn v&agrave; thực h&agrave;nh bằng phần mềm Dự to&aacute;n BNSC của C&ocirc;ng ty Bắc Nam (đ&acirc;y l&agrave; phần mềm đang được &aacute;p dụng phổ biến tại c&aacute;c tỉnh, th&agrave;nh). Kết quả qu&aacute; tr&igrave;nh thực h&agrave;nh nhằm gi&uacute;p người học ho&agrave;n th&agrave;nh việc Lập dự to&aacute;n ho&agrave;n chỉnh một c&ocirc;ng tr&igrave;nh; biết kiểm tra, thẩm định lại hồ sơ dự to&aacute;n x&acirc;y dựng; biết c&aacute;ch x&aacute;c định Gi&aacute; dự thầu khi nh&agrave; thầu tham gia đấu thầu thi c&ocirc;ng x&acirc;y dựng,...</span></em></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>Y&ecirc;u cầu kh&oacute;a học (Course Requirement):</strong></p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:12.0pt\">Học vi&ecirc;n được cấp chứng nhận khi đủ c&aacute;c điều kiện:</span></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:12.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt\">Học vi&ecirc;n được y&ecirc;u cầu dự &iacute;t nhất 11/14 buổi;</span></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:12.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt\">Đạt từ 5.0 điểm trở l&ecirc;n của b&agrave;i thi cuối kh&oacute;a.</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>C&aacute;ch đ&aacute;nh gi&aacute; kh&oacute;a học (Course Assessment):</strong></p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:12.0pt\">Học vi&ecirc;n phải l&agrave;m b&agrave;i thi thực h&agrave;nh tr&ecirc;n m&aacute;y t&iacute;nh, thời gian 120 ph&uacute;t để kiểm tra c&aacute;c kiến thức v&agrave; c&aacute;c kỹ năng đ&atilde; học trong 14 buổi trước đ&oacute;; Điểm đạt </span><span style=\"font-family:symbol; font-size:12.0pt\">&sup3;</span><span style=\"font-size:12.0pt\"> 5.0/10.</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>Phương thức học, thực h&agrave;nh (Learning methods):</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:12.0pt\">Học vi&ecirc;n được hướng dẫn bởi giảng vi&ecirc;n, đồng thời được thực hiện ngay tr&ecirc;n m&aacute;y t&iacute;nh c&aacute; nh&acirc;n (Laptop) tại ph&ograve;ng học để tăng t&iacute;nh hiệu quả của b&agrave;i học. Sau buổi học, học vi&ecirc;n được giao b&agrave;i tập về nh&agrave; để thực h&agrave;nh th&ecirc;m.</span></p>', '<p>THS. DƯƠNG C&Ocirc;NG ĐỨC</p>', 1, NULL, '2018-06-15 03:42:57', '2018-06-18 13:21:52', 'Đo, bóc khối lượng và lập dự toán xây dựng', 'Đo, bóc khối lượng và lập dự toán xây dựng', 'Đo, bóc khối lượng và lập dự toán xây dựng', '/uploads/courses/do-boc-khoi-luong-va-lap-du-toan-xay-dung2018-06-15.jpg'),
(17, 'Thiết kế nền móng, tường hầm bằng Plaxis', 'KH17', 'thiet-ke-nen-mong-tuong-ham-bang-plaxis', 'Thiết kế nền móng, tường hầm bằng Plaxis\r\nVới phần mềm Plaxis: Khóa học giúp cho các kỹ sư ôn lại  các kiến thức về cơ đất-nền móng, sử dụng thành thạo phần mềm Plaxis trong thiết kế các công trình ngầm như móng, tường tầng hầm, tường chắn đất, các bài toán gia cố nền bằng vài địa kỹ thuật...', '<p><em style=\"margin: 0px; padding: 0px; color: rgb(58, 58, 54); font-family: arial, Verdana, Helvetica, sans-serif; font-size: small; text-align: justify;\">&nbsp;Với phần mềm Plaxis:</em><span style=\"color: rgb(58, 58, 54); font-family: arial, Verdana, Helvetica, sans-serif; font-size: small; text-align: justify;\">&nbsp;Khóa học giúp cho các kỹ sư ôn lại&nbsp; các kiến thức về cơ đất-nền móng, sử dụng thành thạo phần mềm Plaxis trong thiết kế các công trình ngầm như móng, tường tầng hầm, tường chắn đất, các bài toán gia cố nền bằng vài địa kỹ thuật...</span><br></p>', '<p>THS. TRẦN HÙNG CƯỜNG</p>', 1, NULL, '2018-06-15 03:51:42', '2018-06-15 03:51:42', 'Thiết kế nền móng, tường hầm bằng Plaxis', 'Thiết kế nền móng, tường hầm bằng Plaxis', 'Thiết kế nền móng, tường hầm bằng Plaxis', '/uploads/courses/thiet-ke-nen-mong-tuong-ham-bang-plaxis2018-06-15.jpg');
INSERT INTO `courses` (`id`, `name`, `code`, `slug`, `sumary`, `content`, `teacher`, `status`, `deleted_at`, `created_at`, `updated_at`, `meta_title`, `meta_keywords`, `meta_description`, `image`) VALUES
(18, 'Thực hành thiết kế kết cấu công trình xây dựng', 'KH18', 'thuc-hanh-thiet-ke-ket-cau-cong-trinh-xay-dung', 'Thực hành thiết kế kết cấu công trình xây dựng (Practice of structural design for civil buildings)\r\nTham gia khóa học, học viên sẽ được thực hành trọn vẹn việc thiết kế kết cấu từ phần móng đến phàn mái của một công trình thực tế áp dụng các tiêu chuẩn, quy chuẩn xây dựng hiện hành bằng cách sử dụng các phần mềm tính toán, trình bày thuyết minh tính toán và thể hiện kết quả tính toán cuối cùng trên bản vẽ chi tiết. Sau khóa học, học viên có thể thiết kế hoàn chỉnh toàn bộ phần kết cấu của một công trình, ghi điểm với các đơn vị tuyển dụng bằng khả năng trình bày văn bản gọn gàng, khoa học. Khóa học phù hợp cho các bạn sinh viên năm cuối chuyên ngành xây dựng, sinh viên mới ra trường muốn rèn luyện thực hành trước khi phỏng vấn tuyển dụng hoặc kỹ sư xây dựng đã đi làm muốn nâng cao chuyên môn về thiết kế kết cấu công trình.', '<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>M&ocirc; tả chung m&ocirc;n học (Course Description):</strong></p>\r\n\r\n<p style=\"margin-left:17.0pt; margin-right:0cm; text-align:justify\"><em><span style=\"font-family:calibri,sans-serif; font-size:12pt\">Thực h&agrave;nh thiết kế kết cấu c&ocirc;ng tr&igrave;nh x&acirc;y dựng bao gồm 20 buổi học</span></em><em><span style=\"font-family:calibri,sans-serif; font-size:12pt\"> v&agrave;</span></em><em><span style=\"font-family:calibri,sans-serif; font-size:12pt\"> thực h&agrave;nh</span></em><em><span style=\"font-family:calibri,sans-serif; font-size:12pt\">,</span></em><em><span style=\"font-family:calibri,sans-serif; font-size:12pt\"> mỗi buổi c&oacute; thời lượng 180 ph&uacute;t. </span></em><em><span style=\"font-family:calibri,sans-serif; font-size:12pt\">Kh&oacute;a học sẽ dạy học vi&ecirc;n c&aacute;ch thiết kế một c&ocirc;ng tr&igrave;nh d&acirc;n dụng thực tế với đầy đủ c&aacute;c cấu kiện như dầm, s&agrave;n, cột v&agrave; m&oacute;ng. Từ c&aacute;c kiến thức từ kh&oacute;a học, học vi&ecirc;n tự tin hơn trong c&ocirc;ng việc thiết kế kết cấu trong c&ocirc;ng việc.</span></em></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>Y&ecirc;u cầu kh&oacute;a học (Course Requirement):</strong></p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:12.0pt\">Học vi&ecirc;n được cấp chứng nhận khi đủ c&aacute;c điều kiện:</span></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:12.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt\">Học vi&ecirc;n được y&ecirc;u cầu dự &iacute;t nhất 15/20 buổi;</span></p>\r\n\r\n<p style=\"margin-left:46.2pt; margin-right:0cm; text-align:justify\"><!--[if !supportLists]--><span style=\"font-family:symbol; font-size:12.0pt\">&middot;<span style=\"font-size:7pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt\">Đạt từ 5.0 điểm trở l&ecirc;n của b&agrave;i thi cuối kh&oacute;a.</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>C&aacute;ch đ&aacute;nh gi&aacute; kh&oacute;a học (Course Assessment):</strong></p>\r\n\r\n<p style=\"margin-left:17.85pt; margin-right:0cm; text-align:justify\"><span style=\"font-size:12.0pt\">Học vi&ecirc;n phải l&agrave;m b&agrave;i thi thực h&agrave;nh tr&ecirc;n m&aacute;y t&iacute;nh, thời gian 120 ph&uacute;t để kiểm tra c&aacute;c kiếm thức v&agrave; c&aacute;c kỹ năng đ&atilde; học trong 20 buổi trước đ&oacute;; Điểm đạt </span><span style=\"font-family:symbol; font-size:12.0pt\">&sup3;</span><span style=\"font-size:12.0pt\"> 5.0/10.</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm; text-align:justify\"><strong>Phương thức học, thực h&agrave;nh (Learning methods):</strong></p>\r\n\r\n<p><span style=\"font-size:12.0pt\">Học vi&ecirc;n được hướng dẫn bởi giảng vi&ecirc;n, đồng thời được thực hiện ngay tr&ecirc;n m&aacute;y t&iacute;nh c&aacute; nh&acirc;n (Laptop) tại ph&ograve;ng học để tăng t&iacute;nh hiệu quả của b&agrave;i học.</span></p>', '<p>THS. NGUYỄN VĂN TH&Ocirc;NG</p>\r\n\r\n<p>THS. NGUYỄN TRUNG HIẾU</p>', 1, NULL, '2018-06-15 04:06:08', '2018-06-18 13:19:29', 'Thực hành thiết kế kết cấu công trình xây dựng', 'Thực hành thiết kế kết cấu công trình xây dựng', 'Thực hành thiết kế kết cấu công trình xây dựng', '/uploads/courses/thuc-hanh-thiet-ke-ket-cau-cong-trinh-xay-dung2018-06-15.jpg');
