INSERT INTO `events` (`id`, `title`, `slug`, `description`, `detail`, `start_date`, `end_date`, `organize_id`, `color_stt_id`, `max_pax`, `place`, `image`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'CAFE DOANH NHÂN #02 - Ứng Dụng CNTT vào Quản Trị Doanh Nghiệp', 'cafe-doanh-nhan-02-ung-dung-cntt-vao-quan-tri-doanh-nghiep', '💎Chủ đề: Ứng Dụng CNTT vào Quản Trị Doanh Nghiệp. \r\nDiễn giả : Ths. Trần Minh Vương- Giám Đốc Công Công Ty Công Nghệ ASC.', '<p>Tiếp nối th&agrave;nh c&ocirc;ng Cafe doanh nh&acirc;n lần 1, BCH CLB tổ chức chương tr&igrave;nh lần 2 :</p>\r\n\r\n<p>Thời gian : 7h30, ng&agrave;y 05/10/2018<br />\r\nĐịa điểm : Biznet Coffee, Villa 18-Khu Villa S&agrave;i G&ograve;n 523 T&ocirc; Hiến Th&agrave;nh, P.14, Q.10.</p>\r\n\r\n<hr />\r\n<h2 style=\"text-align:center\"><span style=\"color:#0000CD\">Chủ đề</span></h2>\r\n\r\n<h2 style=\"text-align:center\"><span style=\"color:#0000CD\">Ứng Dụng CNTT v&agrave;o Quản Trị Doanh Nghiệp.</span></h2>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:16px\"><strong>Diễn giả : Ths. Trần Minh Vương -&nbsp;</strong></span><span style=\"font-size:16px\"><strong>Gi&aacute;m Đốc&nbsp;C&ocirc;ng Ty C&ocirc;ng Nghệ ASC.</strong></span></p>\r\n\r\n<hr />\r\n<p>Ngo&agrave;i th&agrave;nh vi&ecirc;n CLB c&ograve;n c&oacute; tham gia giao lưu của c&aacute;c Doanh nh&acirc;n của c&aacute;c CLB, Hội li&ecirc;n kết như : CLB Doanh Nh&acirc;n C&amp;D, CLB Doanh Nh&acirc;n Ti&ecirc;n Phong Việt Nam, HDN T&acirc;n Ph&uacute;.</p>\r\n\r\n<p>K&iacute;nh mời Anh / Chị đăng k&iacute; tham dự.</p>\r\n\r\n<p><span style=\"color:#FF0000\">📢 Ph&iacute; chia sẻ : 150.000 đ/ người&nbsp;</span></p>\r\n\r\n<h1>Th&agrave;nh Phần đăng k&iacute; tham dự:</h1>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>1. Anh Phạm Văn Th&agrave;nh<br />\r\n			2. Anh Nguyễn Văn Lăng<br />\r\n			3. Anh Trần Minh Thanh<br />\r\n			4. Anh Huỳnh Danh Dự<br />\r\n			5. Anh Phan Văn Đắc<br />\r\n			6. Anh Nguyễn Minh Hiền<br />\r\n			7. Anh Trần Phước Lộc<br />\r\n			8. JOlie Phương<br />\r\n			9. Chị Trần Thị Mỹ Ti&ecirc;n<br />\r\n			10. Anh Kiều Quốc Anh</td>\r\n			<td>11. Chị Nguyễn Thị Mỹ Hạnh<br />\r\n			12. Chị Nguyễn Xu&acirc;n Thu&yacute; Huỳnh<br />\r\n			13. Anh Trịnh Duy Kỳ<br />\r\n			14. Anh Trần Minh Vương<br />\r\n			15. Anh Trần Thanh Phong<br />\r\n			16. Chị Nguyễn Xu&acirc;n Thu&yacute; Huỳnh<br />\r\n			17. Anh Nguyễn Văn T&iacute;n<br />\r\n			18. Anh Đỗ Ho&agrave;ng T&ocirc;n<br />\r\n			19. Anh Nguyễn Văn T&acirc;n<br />\r\n			20. Chị Dương Thị Thu Hằng</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>......<br />\r\nDanh s&aacute;ch kh&aacute;ch mời sẽ li&ecirc;n tục được cập nh&acirc;t!</p>\r\n\r\n<p>Tr&acirc;n Trọng,</p>', '2018-10-05 07:30:42', '2018-10-05 11:00:49', NULL, NULL, 100, '523 Tô Hiến Thành, P.14, Q.10', '/uploads/images/Capture.JPG', NULL, '2018-10-02 01:04:21', '2018-10-02 14:49:42'),
(2, 'Gala \"Doanh nhân Tân Phú - 15 năm vững tiến\"', 'gala-doanh-nhan-tan-phu-15-nam-vung-tien', 'Kính mời Quý Hội viên; Quý Nhà tài trợ; Quý vị khách mời đến tham dự Chuỗi chương trình Trưng bày sản phẩm - Talkshow - Gala \"Doanh nhân Tân Phú - 15 năm vững tiến\" diễn ra vào 14h00 ngày 09/10/2018 tại Trung tâm Hội nghị Tiệc cưới Melisa - 85 Thoại Ngọc Hầu, Phường Hòa Thạnh, Quận Tân Phú', '<p>Chuỗi chương tr&igrave;nh: Trưng b&agrave;y sản phẩm - Talkshow - Gala &quot;Doanh nh&acirc;n T&acirc;n Ph&uacute; - 15 năm vững tiến&quot;</p>\r\n\r\n<p>K&iacute;nh mời Qu&yacute; Hội vi&ecirc;n; Qu&yacute; Nh&agrave; t&agrave;i trợ; Qu&yacute; vị kh&aacute;ch mời đến tham dự Chuỗi chương tr&igrave;nh&nbsp;Trưng b&agrave;y sản phẩm - Talkshow - Gala &quot;Doanh nh&acirc;n T&acirc;n Ph&uacute; - 15 năm vững tiến&quot; diễn ra v&agrave;o&nbsp;<strong>14h00</strong>&nbsp;ng&agrave;y&nbsp;<strong>09/10/2018&nbsp;</strong>tại&nbsp;<strong>Trung t&acirc;m Hội nghị Tiệc cưới Melisa - 85 Thoại Ngọc Hầu, Phường H&ograve;a Thạnh, Quận T&acirc;n Ph&uacute;</strong><br />\r\nVới hơn 45 đơn vị Doanh nghiệp trong v&agrave; ngo&agrave;i hội tham gia trưng b&agrave;y sản phẩm v&agrave; dịch vụ, talkshow với chủ đề &quot;Chiến tranh Thương mại Mỹ - Trung; C&aacute;ch mạng 4.0: Cơ hội v&agrave; th&aacute;ch thức cho SMEs&quot; của diễn giả - Tiến sĩ Huỳnh Thanh Điền v&agrave; đ&ecirc;m Gala trong kh&ocirc;ng gian trang trọng, c&ugrave;ng với c&aacute;c kh&aacute;ch mời l&atilde;nh đạo Quận, l&atilde;nh đạo Hiệp Hội Doanh nghiệp TP.HCM, hứa hẹn sẽ l&agrave; một sự kiện đầy cảm x&uacute;c v&agrave; ấm &aacute;p t&igrave;nh doanh nh&acirc;n T&acirc;n Ph&uacute;<br />\r\n<br />\r\n<img alt=\"Thu moi website\" src=\"https://www.hoidoanhnghieptanphu.vn/uploads/news/2018_10/thu-moi-website.jpg\" style=\"height:1217px; width:753px\" /></p>', '2018-10-09 14:00:56', '2018-10-09 18:00:34', NULL, NULL, 1000, 'Trung tâm Hội nghị Tiệc cưới Melisa - 85 Thoại Ngọc Hầu, Phường Hòa Thạnh, Quận Tân Phú', '/uploads/images/medias/thu-moi-website.jpg', NULL, '2018-10-07 07:58:12', '2018-10-08 02:49:42');
