INSERT INTO `pages` (`id`, `name`, `slug`, `url`, `sort_order`, `author_id`, `status`, `content`, `image`, `start_display`, `end_display`, `meta_title`, `meta_keyworks`, `meta_description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Giới thiệu', 'gioi-thieu', NULL, 0, 4, 1, '<p>- CLB Doanh nh&acirc;n T&acirc;y Ninh &ndash; Sài Gòn tổ chức x&atilde; hội phi lợi nhuận, hoạt động theo nguy&ecirc;n tắc tự nguyện, tự quản, tu&acirc;n thủ theo c&aacute;c quy định của ph&aacute;p luật nước Cộng h&ograve;a x&atilde; hội chủ nghĩa Việt Nam v&agrave; theo Điều lệ n&agrave;y.</p>\r\n\r\n<p>- Tập hợp, gắn kết tất cả c&aacute;c hội vi&ecirc;n l&agrave; những người con T&acirc;y Ninh (kể cả d&acirc;u/rể) đang l&agrave;m việc, nghi&ecirc;n cứu, quản l&yacute; v&agrave; điều h&agrave;nh tại c&aacute;c cơ quan, doanh nghiệp thuộc c&aacute;c th&agrave;nh phần kinh tế, được th&agrave;nh lập v&agrave; hoạt động theo đ&uacute;ng ph&aacute;p luật.</p>\r\n\r\n<p>- Tăng cường giao lưu, trao đổi kinh nghiệm, hỗ trợ v&agrave; gi&uacute;p đỡ nhau c&ugrave;ng ph&aacute;t triển, tất v&igrave; sự th&agrave;nh đạt v&agrave; ph&aacute;t triển của c&aacute;c hội vi&ecirc;n. - CLB Doanh nh&acirc;n T&acirc;y Ninh &ndash; Sài Gòn l&agrave; k&ecirc;nh vận động c&aacute;c hội vi&ecirc;n t&iacute;ch cực tham gia v&agrave;o c&aacute;c hoạt động hỗ trợ cộng đồng, c&ocirc;ng t&aacute;c từ thiện x&atilde; hội tr&ecirc;n địa b&agrave;n tỉnh T&acirc;y Ninh cũng như một số tỉnh/th&agrave;nh kh&aacute;c.</p>', '/uploads/pages/gioi-thieu2018-06-01.PNG', NULL, NULL, 'Giới thiệu', 'Giới thiệu', 'Giới thiệu', NULL, '2018-06-01 03:14:09', '2018-09-29 09:56:19'),
(2, 'Terms & Conditions', 'terms-conditions', NULL, 0, 4, 1, '<p>Terms &amp; Conditions</p>\r\n\r\n<p><img alt=\"\" src=\"/uploads/images/pages/doi-ngu-giang-vien-uy-tin-nhiet-tinh2018-06-06.jpg\" style=\"height:235px; width:270px\" /></p>', '/uploads/images/pages/co-hoi-thuc-tap-va-duoc-tuyen-dung2018-06-06.jpg', NULL, NULL, 'Terms & Conditions', 'Terms & Conditions', 'Terms & Conditions', NULL, '2018-06-08 15:34:53', '2018-06-17 03:20:09');
