INSERT INTO `posts` (`id`, `name`, `slug`, `category_id`, `sort_order`, `author_id`, `status`, `sumary`, `content`, `number_view`, `image`, `post_tag`, `start_display`, `end_display`, `meta_title`, `meta_keyworks`, `meta_description`, `deleted_at`, `created_at`, `updated_at`) VALUES
(35, 'Chúc mừng Khai Trương Cty CP CHEETAH LOGISTICS', 'chuc-mung-khai-truong-cong-ty-cp-cheetah-logistics', NULL, 0, 4, 1, NULL, '<p>Ch&uacute;c mừng Khai Trương Cty CP CHEETAH LOGISTICS do doanh nh&acirc;n Hội Vi&ecirc;n Anh Nguyễn Thanh Hiền đầu tư. Ch&uacute;c Cty Khai Trương Hồng Ph&aacute;t.</p>\r\n\r\n<p>Doanh nghiệp c&oacute; nhu cầu sử dụng dịch vụ Logistic li&ecirc;n hệ Anh Nguyễn Thanh Hiền nh&eacute; !</p>\r\n\r\n<p><img alt=\"\" src=\"/uploads/images/41671490_2365621646829400_4527213834305273856_n.jpg\" style=\"height:960px; width:720px\" /></p>', 0, '/uploads/images/41671490_2365621646829400_4527213834305273856_n.jpg', 'Logistics,Doanh Nghiệp Hội Viên', '2018-08-31 17:00:00', NULL, 'Chúc mừng Khai Trương Cty CP CHEETAH LOGISTICS', 'Chúc mừng Khai Trương Cty CP CHEETAH LOGISTICS', 'Chúc mừng Khai Trương Cty CP CHEETAH LOGISTICS', NULL, '2018-09-29 10:03:15', '2018-09-29 10:03:15'),
(36, '[TUYỂN DỤNG] CTY TNHH TV TK XÂY DỰNG ART LAN', 'tuyen-dung-cty-tnhh-tv-tk-xay-dung-art-lan', NULL, 0, 4, 1, NULL, '<p>CTY TNHH TV TK X&Acirc;Y DỰNG ART LAN</p>\r\n\r\n<p>Cần tuyển<br />\r\nKiến tr&uacute;c sư/ Nh&acirc;n vi&ecirc;n thiết kế nội thất<br />\r\n- Kinh nghiệm: 1 năm<br />\r\n- Tr&igrave;nh độ: Đại học<br />\r\n- Tỉnh/Th&agrave;nh phố: Việc l&agrave;m Hồ Ch&iacute; Minh<br />\r\n- Ng&agrave;nh nghề: Kiến tr&uacute;c/Nội thất, Thiết kế/Mỹ thuật<br />\r\n- Số lượng tuyển dụng: 2<br />\r\n- Giới t&iacute;nh: Kh&ocirc;ng y&ecirc;u cầu<br />\r\n- T&iacute;nh chất c&ocirc;ng việc: Giờ h&agrave;nh ch&iacute;nh<br />\r\n- H&igrave;nh thức l&agrave;m việc: Nh&acirc;n vi&ecirc;n ch&iacute;nh thức<br />\r\nM&ocirc; tả&nbsp;<br />\r\n- Dựng phối cảnh 3D<br />\r\n- Triển khai hồ sơ kỹ thu&acirc;t 2D theo y&ecirc;u cầu thiết kế nội thất của kh&aacute;ch h&agrave;ng.<br />\r\n- C&ocirc;ng việc cụ thể sẽ được trao đổi cụ thể trong qu&aacute; tr&igrave;nh phỏng vấn</p>\r\n\r\n<p>Y&ecirc;u cầu&nbsp;<br />\r\n- C&oacute; kinh nghiệm 1 - 2 năm<br />\r\n- Ưu ti&ecirc;n ứng vi&ecirc;n tốt nghiệp Trường Văn Lang, Kiến Tr&uacute;c...<br />\r\n- Nắm vững chuy&ecirc;n m&ocirc;n, Sử dụng th&agrave;nh thạo c&aacute;c chương tr&igrave;nh đồ hoạ (3Dmax, photoshop, Autocad &hellip;)&nbsp;<br />\r\n- Chịu kh&oacute;, y&ecirc;u nghề<br />\r\n- Đam m&ecirc; l&agrave;m việc trong lĩnh vực trang tr&iacute;, thiết kế nội thất<br />\r\n- C&oacute; tinh thần s&aacute;ng tạo,<br />\r\n- Năng lực tư duy đ&ocirc;̣c l&acirc;̣p và tr&igrave;nh b&agrave;y &yacute; tưởng thiết kế.</p>\r\n\r\n<p>Quyền lợi&nbsp;<br />\r\n- M&ocirc;i trường l&agrave;m việc năng động, chuy&ecirc;n nghiệp v&agrave; th&acirc;n thiện<br />\r\n- Tham gia BHXH, BHYT theo quy định của luật lao động<br />\r\n- Hưởng c&aacute;c chế độ theo quy định của C&ocirc;ng ty<br />\r\nThưởng th&aacute;ng 13<br />\r\n- Trao đổi cụ thể khi phỏng vấn.<br />\r\n- Mức lương thoa thuận t&ugrave;y theo năng lực.</p>', 0, '/uploads/images/42719776_2084062921605000_2173115836728868864_n.jpg', '[TUYỂN DỤNG] CTY TNHH TV TK XÂY DỰNG ART LAN', '2018-09-01 17:00:00', NULL, '[TUYỂN DỤNG] CTY TNHH TV TK XÂY DỰNG ART LAN', '[TUYỂN DỤNG] CTY TNHH TV TK XÂY DỰNG ART LAN', '[TUYỂN DỤNG] CTY TNHH TV TK XÂY DỰNG ART LAN', NULL, '2018-09-29 10:09:12', '2018-09-29 10:09:12'),
(37, '[TUYỂN DỤNG] MERRY MOM SPA', 'tuyen-dung-merry-mom-spa', NULL, 0, 4, 1, NULL, '<p><img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f1a/1/16/1f33b.png\" style=\"height:16px; width:16px\" />🌻Th&ocirc;ng tin tuyển dụng<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f9e/1/16/27a1.png\" style=\"height:16px; width:16px\" />➡️MERRY MOM SPA cần tuyển GẤP Tiếp t&acirc;n ki&ecirc;m nh&acirc;n vi&ecirc;n h&agrave;nh ch&iacute;nh<br />\r\n<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f6f/1/16/1f337.png\" style=\"height:16px; width:16px\" />🌷Y&ecirc;u cầu:<br />\r\n- Ngoại h&igrave;nh dễ nh&igrave;n<br />\r\n- Biết sử dụng vi t&iacute;nh<br />\r\n- Giao tiếp Tiếng Anh<br />\r\n<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f6b/1/16/1f333.png\" style=\"height:16px; width:16px\" />🌳Giờ l&agrave;m việc (theo ca): 9-13h, 13-17h, 17-20h hoặc trọn ca 9h-20h, tuần nghỉ 1 ng&agrave;y<br />\r\n<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f77/1/16/1f3e1.png\" style=\"height:16px; width:16px\" />🏡Nơi l&agrave;m việc: MERRY MOM SPA, tầng trệt An Gia Skyline , 89 Ho&agrave;ng Quốc Việt, p.Ph&uacute; Thuận, quận7<br />\r\n<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f57/1/16/1f4f1.png\" style=\"height:16px; width:16px\" />📱Li&ecirc;n hệ: 0933.110.677 hoặc 0913.678.511 ( c.Hạnh), email: hanh74003@gmail.com</p>', 0, '/uploads/images/42719776_2084062921605000_2173115836728868864_n.jpg', '[TUYỂN DỤNG] MERRY MOM SPA', '2018-09-29 11:40:10', NULL, '[TUYỂN DỤNG] MERRY MOM SPA', '[TUYỂN DỤNG] MERRY MOM SPA', '[TUYỂN DỤNG] MERRY MOM SPA', NULL, '2018-09-29 11:40:10', '2018-09-29 11:40:10'),
(38, '[TUYỂN DỤNG] Công Ty TNHH Vata Việt Nam', 'tuyen-dung-cong-ty-tnhh-vata-viet-nam', NULL, 0, 4, 1, NULL, '<p><img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f1e/1/16/1f33f.png\" style=\"height:16px; width:16px\" />🌿<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f1e/1/16/1f33f.png\" style=\"height:16px; width:16px\" />🌿<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f1e/1/16/1f33f.png\" style=\"height:16px; width:16px\" />🌿Th&ocirc;ng B&aacute;o Tuyển Dụng<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f1e/1/16/1f33f.png\" style=\"height:16px; width:16px\" />🌿<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f1e/1/16/1f33f.png\" style=\"height:16px; width:16px\" />🌿<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f1e/1/16/1f33f.png\" style=\"height:16px; width:16px\" />🌿<br />\r\nC&ocirc;ng Ty TNHH Vata Việt Nam cần tuyển<br />\r\n<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f1e/1/16/1f33f.png\" style=\"height:16px; width:16px\" />🌿3 nh&acirc;n vi&ecirc;n marketing online chuy&ecirc;n về chăm s&oacute;c fanpage<br />\r\n<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f87/1/16/1f340.png\" style=\"height:16px; width:16px\" />🍀y&ecirc;u cầu:<br />\r\n+ nữ tuổi từ 18-30<br />\r\n+ c&oacute; hiểu biết về fanpage v&agrave; chăm s&oacute;c fanpage kinh nghiệm tr&ecirc;n 6 th&aacute;ng<br />\r\n+ tốt nghiệp 12 trở l&ecirc;n.<br />\r\n<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f87/1/16/1f340.png\" style=\"height:16px; width:16px\" />🍀lương thử việc 4tr/th&aacute;ng<br />\r\n<img alt=\"\" role=\"presentation\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/f87/1/16/1f340.png\" style=\"height:16px; width:16px\" />🍀lương ch&iacute;nh thức 6tr/th&aacute;ng + thưởng doanh số<br />\r\nĐịa chỉ nhận Hồ sơ: cty TNHH Vata Việt Nam số 288/29 L&ecirc; Văn quới, phường B&igrave;nh hưng H&ograve;a A, B&Igrave;nh T&acirc;n.<br />\r\nSĐT: 0936735631 Gặp MY<br />\r\nMail: CONGTYVATAVIETNAM@GMAIL.COM</p>', 0, '/uploads/images/42719776_2084062921605000_2173115836728868864_n.jpg', 'Công Ty TNHH Vata Việt Nam', '2018-09-08 17:00:00', NULL, 'Công Ty TNHH Vata Việt Nam', 'Công Ty TNHH Vata Việt Nam', 'Công Ty TNHH Vata Việt Nam', NULL, '2018-09-29 11:41:19', '2018-09-29 11:41:19'),
(39, 'Chúc Mừng Khai Trương Chi Nhánh Mới - Công Ty Tôn Thép Sài Gòn', 'chuc-mung-khai-truong-chi-nhanh-moi-cong-ty-ton-thep-sai-gon', NULL, 0, 4, 1, NULL, '<p><img alt=\"\" src=\"/uploads/images/khaitruongttsg.jpg\" style=\"height:450px; width:600px\" /></p>\r\n\r\n<p>Đại diện BCH CLB đến tham dự lễ khai trương Chi Nh&aacute;nh thứ 4 Ph&uacute; Hưng , Bến Tre - Cty T&ocirc;n Th&eacute;p S&agrave;i G&ograve;n.</p>\r\n\r\n<p><img alt=\"\" src=\"/uploads/images/ttsg.jpg\" style=\"height:450px; width:600px\" /><br />\r\nXin ch&uacute;c mừng C&ocirc;ng Ty T&ocirc;n Th&eacute;p S&agrave;i G&ograve;n v&agrave; CEO Ms Trịnh Thị Thu Hồng, Khai trương Hồng Ph&aacute;t v&agrave; xin ch&uacute;c Cty ng&agrave;y c&agrave;ng ph&aacute;t triển v&agrave; thịnh vượng !</p>\r\n\r\n<p>CH&Uacute;C KHAI TRƯƠNG HỒNG PH&Aacute;T !</p>', 0, '/uploads/images/khaitruongttsg.jpg', NULL, '2018-09-28 17:00:00', NULL, 'Chúc Mừng Khai Trương Chi Nhánh Mới - Công Ty Tôn Thép Sài Gòn', 'Chúc Mừng Khai Trương Chi Nhánh Mới - Công Ty Tôn Thép Sài Gòn', 'Chúc Mừng Khai Trương Chi Nhánh Mới - Công Ty Tôn Thép Sài Gòn', NULL, '2018-09-29 11:51:42', '2018-09-29 11:52:23'),
(40, 'THÔNG BÁO CHUYỂN VĂN PHÒNG MỚI - CÔNG TY TNHH THIÊN PHÚC TRẦN', 'thong-bao-chuyen-van-phong-moi-cong-ty-tnhh-thien-phuc-tran', NULL, 0, 4, 1, NULL, '<h2><strong>C&Ocirc;NG TY TNHH THI&Ecirc;N PH&Uacute;C TRẦN</strong></h2>\r\n\r\n<h2>TR&Acirc;N TRỌNG TH&Ocirc;NG B&Aacute;O CHUYỂN VĂN PH&Ograve;NG MỚI</h2>\r\n\r\n<h2><strong>Địa chỉ mới: 606/168 Đường 3 th&aacute;ng 2, Phường 14. Quận 10 TPHCM</strong></h2>\r\n\r\n<h2><span style=\"color:#FF0000\">KỂ TỪ NG&Agrave;Y 01/10/2018</span></h2>\r\n\r\n<p>Nh&acirc;n dịp khai trương văn ph&ograve;ng mới, Cty THI&Ecirc;N PH&Uacute;C TRẦN Tr&acirc;n trọng, k&iacute;nh mời anh chị em d&agrave;nh thời gian qu&yacute; gi&aacute; đến thăm v&agrave; ủng hộ.&nbsp;<br />\r\nThời gian v&agrave; địa điểm:&nbsp;<br />\r\nThứ 3 ng&agrave;y 2/10/2018, v&agrave;o l&uacute;c 8h00 tại số 606/168 Đường 3/2 Phường 14, Quận 10, TPHCM<br />\r\nRất mong sự cơ mặt v&agrave; hiện diện của ACE v&agrave; bạn b&egrave; gần xa<br />\r\n===================<br />\r\nC&Ocirc;NG TY TNHH THI&Ecirc;N PH&Uacute;C TRẦN<br />\r\nChuy&ecirc;n cung cấp văn ph&ograve;ng phẩm- Nhu yếu phẩm v&agrave; Thiết bị văn ph&ograve;ng<br />\r\nDịch vụ tư vấn th&agrave;nh lập doanh nghiệp- tư vấn thuế<br />\r\nWebsite:&nbsp;<a href=\"http://www.thienphuctran.com/\" target=\"_blank\">www.thienphuctran.com</a>&nbsp;ĐT: 0903385303 (zalo,viber) - 028 36365303<br />\r\nRất h&acirc;n hạnh được tiếp đ&oacute;n v&agrave; phục vụ qu&yacute; anh chị</p>\r\n\r\n<p>P/s: Nh&acirc;n dịp khai trương b&ecirc;n e sẽ c&oacute; phần qu&agrave; tặng... cho 10 đơn h&agrave;ng c&oacute; trị gi&aacute; từ 1 triệu đồng trở l&ecirc;n.</p>', 0, '/uploads/images/dexus-office-space.jpg', 'CHUYỂN VĂN PHÒNG', '2018-10-01 00:02:53', NULL, 'CÔNG TY TNHH THIÊN PHÚC TRẦN', 'CÔNG TY TNHH THIÊN PHÚC TRẦN', 'CÔNG TY TNHH THIÊN PHÚC TRẦN', NULL, '2018-10-01 00:02:53', '2018-10-01 00:02:53');
