(61, '它不能否认塑料袋的便利性', 'san-pham-red-sun-2', 1, NULL, '/uploads/images/medias/hinh_1.jpg', NULL, 332500, 319000, 'PIN003', NULL, 0, NULL, '<p>它不能否认塑料袋的便利性，但过度使用塑料袋和缺乏废物处理方法已经破坏了我们的环境。 现在，塑料袋是人类和环境的敌人。自10月以来，除超市外，还禁止糖果向韩国客户提供免费塑料袋。 在澳大利亚，Coles超市连锁店自本月初开始提供一个月的免费环保袋，目的是帮助顾客调整购物习惯，并准备将来停止使用塑料袋。</p>', NULL, 0, NULL, NULL, 1, NULL, NULL, NULL, '2018-09-27 03:33:30', '2018-09-27 03:34:44', '<p>ddd</p>', NULL, NULL, 10, 16, NULL, NULL, NULL, NULL, NULL),
